import React, { useState } from "react";
import Select from "react-select";
import "bootstrap/dist/css/bootstrap.min.css";
import "./Home.css";

const cities = [
  { value: "Dhaka", label: "Dhaka" },
  { value: "Chittagong", label: "Chittagong" },
  { value: "Rajshahi", label: "Rajshahi" },
  { value: "Khulna", label: "Khulna" },
  { value: "Sylhet", label: "Sylhet" },
  { value: "Barisal", label: "Barisal" },
  { value: "Rangpur", label: "Rangpur" },
  { value: "Mymensingh", label: "Mymensingh" },
];

const selectStyles = {
  control: (base) => ({
    ...base,
    fontSize: "16px",
    borderColor: "#ced4da",
    boxShadow: "none",
  }),
  placeholder: (base) => ({
    ...base,
    color: "#495057",
  }),
  singleValue: (base) => ({
    ...base,
    color: "#212529",
  }),
  option: (base, state) => ({
    ...base,
    color: state.isSelected ? "white" : "#212529",
    backgroundColor: state.isSelected
      ? "#198754"
      : state.isFocused
      ? "#e9ecef"
      : "white",
  }),
  menu: (base) => ({
    ...base,
    zIndex: 9999,
  }),
};

function Home() {
  const [fromCity, setFromCity] = useState(null);
  const [toCity, setToCity] = useState(null);
  const [date, setDate] = useState("");

  const handleSearch = () => {
    if (fromCity && toCity && date) {
      alert(`Searching from ${fromCity.label} to ${toCity.label} on ${date}`);
    } else {
      alert("Please fill out all fields.");
    }
  };

  return (
    <div className="home-page">
      <div className="hero-section text-white d-flex align-items-center justify-content-center">
        <div className="search-box bg-white p-4 rounded shadow-lg">
          <div className="d-flex justify-content-start mb-3">
            <div className="form-check me-3">
              <input
                className="form-check-input"
                type="radio"
                name="tripType"
                defaultChecked
              />
              <label className="form-check-label">One Way</label>
            </div>
            <div className="form-check">
              <input
                className="form-check-input"
                type="radio"
                name="tripType"
              />
              <label className="form-check-label">Round Trip</label>
            </div>
          </div>

          <div className="row g-2">
            <div className="col-md-4">
              <Select
                options={cities}
                placeholder="From"
                value={fromCity}
                onChange={setFromCity}
                styles={selectStyles}
              />
            </div>
            <div className="col-md-4">
              <Select
                options={cities}
                placeholder="To"
                value={toCity}
                onChange={setToCity}
                styles={selectStyles}
              />
            </div>
            <div className="col-md-3">
              <input
                type="date"
                className="form-control"
                value={date}
                onChange={(e) => setDate(e.target.value)}
              />
            </div>
            <div className="col-md-1 d-grid">
              <button className="btn btn-success" onClick={handleSearch}>
                Search
              </button>
            </div>
          </div>
        </div>
      </div>

      <div className="container text-center my-5">
        <h2>
          <span className="text-success">Buy tickets</span> in 3 easy steps
        </h2>
        <div className="row mt-4">
          <div className="col-md-4">
            <h5>🔍 Search</h5>
            <p>
              Choose your origin, destination, journey dates and search for
              buses
            </p>
          </div>
          <div className="col-md-4">
            <h5>🪑 Select</h5>
            <p>Select your desired trip and choose your seats</p>
          </div>
          <div className="col-md-4">
            <h5>💳 Pay</h5>
            <p>Pay by bank cards or mobile banking</p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
